@AdamVe I managed to create a script that sorts strings identically to app_en.arb. Maybe it will be useful as a base.
```
# Function to change '@@locale' from 'en' to 'pl'
def change_locale(line):
    if '"@@locale": "en"' in line:
        line = line.replace('"@@locale": "en"', '"@@locale": "pl"')
    return line

# Opening app_en.arb as a source and unsorted translated arb_pl.arb file
with open('app_en.arb', 'r', encoding='utf-8') as en_file, open('app_pl.arb', 'r', encoding='utf-8') as pl_file:
    en_lines = en_file.readlines()
    pl_lines = pl_file.readlines()

# Function to return the key from the line
def get_key(line):
    parts = line.split(':', 1)
    return parts[0].strip() if len(parts) > 1 else None

# Function to increase indentation for placeholders
def increase_indentation(line, spaces=0):
    return ' ' * spaces + line

# Creating a dictionary for translations
translation_dict = {}
for pl_line in pl_lines:
    if pl_line.strip():
        key = get_key(pl_line)
        if key is not None:
            value = pl_line.split(':', 1)[1].strip()
            translation_dict[key] = value

# Opening the result file for writing
with open('app_plv2.arb', 'w', encoding='utf-8') as output_file:
    in_placeholders = False
    for en_line in en_lines:
        # change key'@@locale' from 'en' to 'pl'
        en_line = change_locale(en_line)
        key = get_key(en_line)
        if key is not None:
            if key == '"placeholders"':
                in_placeholders = True
                output_file.write(increase_indentation(en_line))
            else:
                if in_placeholders:
                    output_file.write(increase_indentation(en_line))
                elif key in translation_dict:
                    output_file.write(f'    {key}: {translation_dict[key]}\n')
                else:
                    output_file.write(en_line)
        else:
            # If a line does not contain a key, keep it
            output_file.write(en_line)
            if in_placeholders:
                in_placeholders = False

print("Plik 'app_plv2.arb' został wygenerowany z zwiększonym wcięciem wewnątrz 'placeholders' i zachowuje tłumaczenia z 'app_pl.arb'.")
